//initial-config.service.ts
import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Router } from '@angular/router';
import { GLOBAL } from '../config/GLOBAL';
import { Observable, tap } from 'rxjs';


@Injectable({
  providedIn: 'root'
})
export class InitialConfigService {

  private url: string = GLOBAL.url;
  private setupRequired: boolean | null = null;

  constructor(private _http: HttpClient, private _router: Router) { }


  InitialCheck(): Observable<any> {
    return this._http.get<any>(`${this.url}InitialCheck`).pipe(
      tap(response => {
        this.setupRequired = response.data.setupRequired;
      })
    );
  }

  getSetupRequiredSync(): boolean | null {
    return this.setupRequired;
  }

  createMasterAdmin(data: any): Observable<any> {
    return this._http.post(`${this.url}createMasterAdmin`, data);
  }

}
